    def __init__(self,tot,tot_pr):
        tot = ''
        tot_pr = 0.00
        self.tot = tot
        self.tot_pr = tot_pr

    def finished_clicked(self):
        if self.tot_pr == 0.00:
            self.calc_found.setText("Please at least add One Item!!")
            self.calc_found.adjustSize()
        
        else:
            self.calc_found.setText("")
            self.label.setText("")
            self.label_2.setText("")
            self.calc_item.deleteLater()
            self.calc_add.deleteLater()
            self.calc_finished.deleteLater()
            self.calc_quan.deleteLater()   
            print(self.tot + f'                Total : {self.tot_pr}')
            self.tot_list.setGeometry(QtCore.QRect(10, 10, 551, 371))
            self.tot_list.setText(f'                      List \n{self.tot}' + f'                                  Total : {self.tot_pr}')
            self.tot_list.adjustSize()
            
    def add_clicked(self):
        item_name = self.calc_item.toPlainText()
        item_quan = self.calc_quan.value()
        if item_name == '':
            self.calc_found.setText("Please Enter on the Item area!!")
            self.calc_found.adjustSize()
        elif item_quan == 0.00:
            self.calc_found.setText("Quantity can not be 0.00!!")
            self.calc_found.adjustSize()
        else:
            from time import sleep
            from calc import Calc
            
            ca = Calc(item_name,item_quan,float())
            ca_val = ca.validity()

            self.calc_found.setText("Please Wait...")
            self.calc_found.adjustSize()
            self.calc_found.show()
            self.calc_found.repaint()
            sleep(0.8)
            if ca_val == False:
                self.calc_found.setText(f"Item called {item_name} doesn't exists\n (Please try with a Valid Item!!)")
                self.calc_found.adjustSize()
                self.calc_found.show()
                self.calc_found.repaint()
            else:
                self.calc_item.clear()
                self.calc_quan.setValue(0.000)
                self.calc_found.setText("")
                self.tot += str(ca.calcapp())+'\n'
                print(self.tot)
                self.tot_pr += ca.si_pr()

